import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Modal from "./modal";

class Game extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: props.id,
      name: props.name,
      availableIn: props.availableIn,
      status: props.status,
      noAvailable: props.noAvailable,
      show: false
    };

    this.onClickHandler = this.onClickHandler.bind(this);
  }
  onClickHandler(e) {
    console.log(e.target.parentElement.id);
    this.setState({
      show: !this.state.show
    });
  }
  render() {
    return (
      <tr onClick={this.onClickHandler} id={this.state.id}>
        <td>{this.state.id}</td>
        <td>{this.state.name}</td>
        <td>
          {this.state.availableIn.map(gameingConsole => gameingConsole + " ")}
        </td>
        <td>{this.state.status}</td>
        <td>{this.state.noAvailable}</td>
        <Modal show={this.state.show} title="Hello" />
      </tr>
    );
  }
}

export default Game;
